void mainSelect() {
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address
	int PS2_data, RVALID;

    // Audio port structure
	/* we don't need to 'reserve memory' for this, it is already there so we just need a pointer to this structure */
	struct audio_t *const audiop = ((struct audio_t *) AUDIO_BASE);
	int countNUN = 0;


	while (1) {
		audiop->ldata = soundsL[countNUN]; // store to the left output fifo
		audiop->rdata = soundsL[countNUN]; // store to the right output fifo 
		countNUN++;
		if(countNUN >= 1995){
			countNUN = 0;
		}
		for(int i = 0; i < 100000; i ++);
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		if (RVALID != 0)
		{
			/* always save the last three bytes received */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}
		if ( (byte2 == 0xAA) && (byte3 == 0x00) )
		{
			// mouse inserted; initialize sending of data
			*(PS2_ptr) = 0xF4;
		}
		// Display last byte on Red LEDs
        if(byte2 == 0xf0){
            int j = 1;
        }
        else if(byte3 == 0x1c){
            selectMain1();
            modeSelecetion = 1;
        }
        else if(byte3 == 0x23){
            selectMain2();
            modeSelecetion = 2;
        }
        else if(byte3 == 0x5A){
            if(modeSelecetion == 1){
                // mazeSelection();
                // wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                // pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
                // mazeSelect();
                mazeOne();
                drawChar();
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
                moveChar();
                if(checkDie){
                    dieWait();
                }
                return;
            }
            if(modeSelecetion == 2){
                drawBlack();
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
            }
        }
        
	}
}

