void moveChar(){
    unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
    int checkbombB = 0;
	
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, RVALID;
    int timeB = 1000000;
    int timeC = 10000;
    int timeD = 0;

    struct audio_t *const audiop = ((struct audio_t *) AUDIO_BASE);
	int countV;


	while (1) {
        if (audiop->rarc > 0 && countV < 1520) {	
			audiop->ldata =  soundsL2[countV]; 
			audiop->rdata =  soundsL2[countV]; 
            countV++;
		}
        else{
            countV = 0;
        }
        if((checkDie == 1) && (timeD <= 0)){
            timeD = 100000;
            checkDie = 0;
            NumHeart--;
        }
        else if((checkDie == 1) && (timeD >= 0)){
            checkDie = 0;
        }
        if((NumHeart == 0) || gateCheck){
                if (audiop->rarc > 0 && countV < 1520) {	
                    audiop->ldata =  0xffffff;
                    audiop->rdata =  0xffffff;
                 }
                if(!gateCheck){
                    checkDie = 1;
                }
                drawDie();
                checkDie = 0;
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
                gateCheck = 0;
                int x, y;
                for (x = 0; x < 320; x++){
                    for (y = 0; y < 280 ; y++){
                        mazeFir[y][x] = mazeCopyFir[y][x];
                    }
                }
                xchar = xcharHold;
                ychar = ycharHold;
                MonX = 260;
                MonY = 40;
                MonC = 1;
                killMon = 0;
                NumHeart = 3;
                dieWait();
                return;
        }
        if((timeC <= 0)&&(!killMon)){
            timeC = 0x10000;
            mazeOne();
            drawChar();
            movMon();
            drawHeart();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		if (RVALID != 0)
		{
			/* always save the last three bytes received */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}
		if ( (byte2 == 0xAA) && (byte3 == 0x00) )
		{
			// mouse inserted; initialize sending of data
			*(PS2_ptr) = 0xF4;
		}
		// Display last byte on Red LEDs
        if(byte2 == 0xf0){
            int j = 1;
        }
        else if(byte3 == 0x1c){
            int check = checkOb(-1,0);
            if(check == 1){
                continue;
            }
            dxchar = -1;
            dychar = 1;
            xchar -= 1;
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if(byte3 == 0x23){
            int check = checkOb(1,0);
            if(check == 1){
                continue;
            }
            dxchar = 1;
            dychar = 1;
            xchar += 1;
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if(byte3 == 0x1d){
            int check = checkOb(0,-1);
            if(check == 1){
                continue;
            }
            dxchar = -1;
            dychar = -1;
            ychar -= 1;
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if(byte3 == 0x1b){
            int check = checkOb(0, 1);
            if(check == 1){
                continue;
            }
            dxchar = 1;
            dychar = -1;
            ychar += 1;
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if((byte3 == 0x29) && (checkbombB == 0)){
            timeB = bombTime;
            checkbombB = 1;
            // overBomb();
            xbomb = xchar;
            ybomb = ychar;
            drawBomb();
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if(byte3 == 0x76){
            xchar = xcharHold;
            ychar = ycharHold;
            MonX = 260;
            MonY = 40;
            MonC = 1;
            killMon = 0;
            NumHeart = 3;
            for (int x = 0; x < 320; x++){
                for (int y = 0; y < 280 ; y++){
                    mazeFir[y][x] = mazeCopyFir[y][x];
                }
            }
            mainPage();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
            mazeSelecetion == 0;
            break;
        }
        if((timeB <= 0) && (checkbombB == 1)){
            checkbombB = 2;
            timeB = 50000;
            drawFire(0xf000);
            mazeOne();
            drawChar();
            drawMon();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        else if((timeB <= 0) && (checkbombB == 2)){
            checkbombB = 0;
            drawFire(0x0);
            mazeOne();
            drawChar();
            drawHeart();
            if(!killMon){
                drawMon();
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffe
        }
        timeD--;
        timeC--;
        timeB--;
	}
    return;
}
    

